INSERT INTO `blood_test_components` (`blood_test_component_id`, `blood_test_component_abbreviation`, `blood_test_component_name`, `blood_test_component_measurement`, `blood_test_component_normal_range`, `blood_test_component_description`) VALUES
(1, 'FVS', 'Fehrvrsejtszm', 'ml', '4300-11000', 'A fehrvrsejtek a szervezet vdekez rendszernek tagjai, a csontvelben termeldnek, a vrben s a nyirokutakban keringenek. Feladatuk az idegen anyagok (baktriumok, vrusok) elpuszttsa. Nem csak a fehrvrsejtek szmt, hanem egyes - rszben ms-ms feladattal br fajtinak arnyt is mrik, s rtkelik a vizsglat sorn.'),
(2, 'VVT', 'Vrsvrtest', 'T/l', '4-6', 'A vrsvrtestek kr alak, kzepkn lapos, sejtmag nlkli sejtek, melyek a vrs csontvelben kpzdnek. lettartama 120 nap, majd a lpben trtnik a lebomls. A vrsvrtest a vrgzok szlltsban nagy szerepet jtszik.'),
(3, 'Htc', 'Hematokrit', '%', '35-50', 'Szzalkos rtk, mely a kifejezi a vrsvrtestek trfogatt a teljes vrmennyisgben.'),
(4, 'Hgb', 'Hemoglobin', 'g/l', '120-170', 'A hemoglobin a vrsvrtestben tallhat molekula, melyekhez ktdik az oxign, gy fontos szerepet jtszik annak szlltsban.'),
(5, 'MCV', 'Mean Cellular Volume', 'fl', '80-95', 'tlagos sejttrfogat, vrsvrtestek tlagos trfogata.'),
(6, 'MCH', 'Mean Corpuscular Hemaglobin', 'pg/sejt', '28-33', 'Egy vrsvrtestre szmtott hemoglobinmennyisg.'),
(7, 'RDW', 'Red blood cell Distribution Width', '%', '11.5-14.5', 'Az RDW meghatrozsra a rutin laborvizsglat keretein bell kerl sor, tbb ms paramterrel egytt.'),
(8, 'PLT', 'Trombocita', 'G/l', '150-400 ', 'A csontvel termeli, sejtmag nlkli elemek. A vralvadsban van szerepe.'),
(9, 'ALT', 'Alanin Amino-Transzferz', 'IU/l', '10-35', 'Az ALT tbb szvetben is megtallhat, de legnagyobb mennyisgben a mj termeli, gy a jelents emelkeds a mjszvet sztessre utal.'),
(10, 'Albumin', 'Albumin', 'g/l', '35-52', 'Az albumin a mjban kpzdik, s nagyon rzkeny a mjkrosodsra. A mj- s a vesebetegsgek szrsre, valamint tpllkozsi llapot becslsre hasznljk.'),
(11, 'sszfehrje', 'sszfehrje', 'g/l', '60-80', 'A fehrjk minden sejt s szvet ptelemei, a vrben a vralvadsi rendszer tagjai, hormonok, szlltmolekulk, enzimek, az immunrendszer mkdsben rsztvev antitestek lehetnek.'),
(12, 'ALP', 'Alkalikus Foszfatz', 'IU/L', '44-147', 'Az alkalikus foszfatz a fehrjk lebontst s a sejtek anyagcsere folyamatait elsegt enzim. Az emberi test minden egyes szvetben megtallhat, nagyobb mennyisgben azonban a belekben, a mjban, a csontokban s a vesben, vrands nk esetben pedig a mhlepnyben is jelen van.'),
(13, 'Bilirubin', 'Bilirubin', 'mg/l', '0-10', 'A bilirubin a vrfestk lebontsi termke, szintje a vrs vrtestek fokozott lebomlsa, mjbetegsgek s epeelfolysi akadly esetn emelkedhet.'),
(14, 'BUN', 'Karbamid (urea)', 'mmol/l', '3.6-7.2', 'A karbamid vagy urea a szervezetben lv fehrje nitrogntartalmnak lebomlsi termke, mely a mjban kpzdik s a vesn keresztl rl ki. Felhalmozdsa a sejtek szmra mrgez lehet. A vrben laboratriumi mdszerekkel mrhet szintjt a vesemkds vizsglatra hasznljk.'),
(15, 'Ca', 'Klcium', 'mg/dL', '8-11', 'A vrben az elem hrom formban van jelen, plazmafehrjkhez ktve, ms ionokhoz ktve (citrt- s foszft-komplexekben), illetve szabad, ionizlt formban. Az ionizlt forma felels az ideg- s az izomszvet ingerlkenysgrt. A kalciumion mennyisgt a vrben emeli a mellkpajzsmirigy-hormon (parathormon, PTH) s a vesben aktivld D-vitamin. Cskkenti a kalciumszintet a pajzsmirigyben termeld kalcitonin.'),
(16, 'Cl-', 'Klorid', 'mmol/l', '99-111', 'A klorid az elektrolitok kz tartozik. Negatv tlts molekula, amely ms elektrolitokkal egytt egytt segt szablyozni a folyadk mennyisgt a szervezetben, s fenntartani a sav-bzis egyenslyt.'),
(17, 'Crea', 'Kreatinin', 'm/l', '55-103', 'A kreatinin az izomanyagcsere vgtermke: az izmokban megtallhat kreatin nev fehrjetermszet anyag bomlsi termke, amely a vesn keresztl tvozik a szervezetbl. A kreatinin vrszintje a vesemkds jelzje, segtsgvel ellenrizhet a vese szrletkpz mkdse.'),
(18, 'OGTT', 'Terhelses vrcukorvizsglat', 'mmol/l', '7.8-11.0', 'A vizsglat a panaszokat mg nem okoz cukorbetegsg, az azt megelz llapot (az gynevezett cskkent glkztolerancia, IGT) s a terhessgi cukorbetegsg felismersre szolgl.'),
(19, 'P', 'Foszfor', 'mg/dL', '2-7', 'A foszftok nlklzhetetlenek az energiatermelshez, izom- s idegmkdshez, csontnvekedshez. Pufferknt fontos szerepk van a szervezet sav-bzis egyenslynak fenntartsban. A foszforvizsglat klnsen fontos azoknl, akik alultplltak vagy akiket ketoacidzissal kezelnek.'),
(20, 'K', 'Klium', 'mmol/l', '3.5-5.0', 'A szrum kliumion koncentrci mrse fontos informcit szolgltathat a folyadkhztartsrl, hormonlis hatsokrl, szmos betegsgben alkalmazott terpia hatsossgrl. A lelet helyes rtkelshez az orvosnak szmos szempontot mrlegelnie kell.'),
(21, 'Na', 'Ntrium', 'mmol/l', '135-145', 'A szrum ntriumion koncentrci mrse fontos informcit szolgltathat a folyadkhztartsrl, hormonlis hatsokrl, szmos betegsgben az alkalmazott kezels hatsossgrl. A lelet helyes rtkelshez az orvosnak szmos szempontot kell mrlegelnie.'),
(22, 'sszkoleszterin', 'sszkoleszterin', 'mmol/l', '0-5', 'Ha tl nagy a koleszterinknlat s a sejtek a rendelkezsre ll mennyisget nem tudjk felhasznlni, az egyensly eltoldik, s a felesleges koleszterin a perifris vrben kering s az erek falban rakdik le. A lerakdott koleszterin kvetkeztben n az relmeszeseds, a szv- s rrendszeri betegsgek s a stroke kialakulsnak kockzata.'),
(23, 'HDL', 'Nagy Srsg Lipoprotein', 'mmol/l', '0.9-999', 'A HDL koleszterin az n. \"j\" koleszterin. Alacsony szintje esetn n az relmeszeseds, a szvinfarktus s az agyvrzs kockzata.'),
(24, 'LDL', 'Alacsony Srsg Lipoprotein', 'mmol/l', '0-3', 'Az LDL (low density lipoprotein  alacsony srsg lipoprotein) funkcijt tekintve a koleszterin szlltst vgzi a mjbl a sejtek irnyba. Br az LDL jelents rsze visszakerl jra a mjba, illetve azok a sejtek veszik fel, melyek koleszterint ignyelnek, kisebb rsze - falsejtek kzvettsvel - az rfalba pl be.');
